webpackJsonp([44713349584700],{711:function(e,t){e.exports={data:{markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 64.07766990291263%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="List of Events"\n        title=""\n        src="/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-31818.png"\n        srcset="/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-b3e18.png 103w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-571c4.png 206w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-31818.png 412w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-1be92.png 618w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-05b5b.png 824w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-17809.png 1236w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  \nEvents are a list of community-curated endurance activities. This list is all about the future. They contain all of the information you might need to prepare for your adventure. Routes, altitude, timezone and much more.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 25.104022191400833%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="List of Events"\n        title=""\n        src="/blog/static/events-05-3f2cc44b013fae14c3aa2823f157124e-31818.png"\n        srcset="/blog/static/events-05-3f2cc44b013fae14c3aa2823f157124e-b3e18.png 103w,\n/blog/static/events-05-3f2cc44b013fae14c3aa2823f157124e-571c4.png 206w,\n/blog/static/events-05-3f2cc44b013fae14c3aa2823f157124e-31818.png 412w,\n/blog/static/events-05-3f2cc44b013fae14c3aa2823f157124e-1be92.png 618w,\n/blog/static/events-05-3f2cc44b013fae14c3aa2823f157124e-05b5b.png 824w,\n/blog/static/events-05-3f2cc44b013fae14c3aa2823f157124e-17809.png 1236w,\n/blog/static/events-05-3f2cc44b013fae14c3aa2823f157124e-27003.png 1442w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  \nClick on the stars next to the titles to “Favorite” events you plan to do and then filter them using the All, Star, or Owner buttons in the main menu.</p>\n<p>Below the title are the days or weeks until the event takes place, making it easy to schedule your season and training.</p>\n<p>Don’t see an event on here you want to do? Just press the Add button in the lower right and add your own event.</p>\n<blockquote>\n<p>If you don’t see the add button, you probably forgot to join the A Race athlete club on Strava (<a href="https://www.strava.com/clubs/araceathlete" target="_blank" rel="nofollow">here</a>).</p>\n</blockquote>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 6.555269922879177%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAABCAIAAABR8BlyAAAACXBIWXMAAAsSAAALEgHS3X78AAAALElEQVQI12P4+///uydPHp87d3v//rcPH/759+/nz5+/8AKggr9///779w8AtHk5RKQW9isAAAAASUVORK5CYII=\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Event Action Links"\n        title=""\n        src="/blog/static/events-04-a275ba342f560317616fbf38edda9415-31818.png"\n        srcset="/blog/static/events-04-a275ba342f560317616fbf38edda9415-b3e18.png 103w,\n/blog/static/events-04-a275ba342f560317616fbf38edda9415-571c4.png 206w,\n/blog/static/events-04-a275ba342f560317616fbf38edda9415-31818.png 412w,\n/blog/static/events-04-a275ba342f560317616fbf38edda9415-1be92.png 618w,\n/blog/static/events-04-a275ba342f560317616fbf38edda9415-05b5b.png 824w,\n/blog/static/events-04-a275ba342f560317616fbf38edda9415-17809.png 1236w,\n/blog/static/events-04-a275ba342f560317616fbf38edda9415-a997c.png 1556w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  </p>\n<ul>\n<li>Permalink to this event to share with fiends</li>\n<li>Add to Google Calendar</li>\n<li>Post this event on Facebook</li>\n<li>Tweet about it on Twitter</li>\n</ul>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 54.41558441558442%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Event Weather"\n        title=""\n        src="/blog/static/events-02-19d7b07e777cb97faf124923384da200-31818.png"\n        srcset="/blog/static/events-02-19d7b07e777cb97faf124923384da200-b3e18.png 103w,\n/blog/static/events-02-19d7b07e777cb97faf124923384da200-571c4.png 206w,\n/blog/static/events-02-19d7b07e777cb97faf124923384da200-31818.png 412w,\n/blog/static/events-02-19d7b07e777cb97faf124923384da200-1be92.png 618w,\n/blog/static/events-02-19d7b07e777cb97faf124923384da200-05b5b.png 824w,\n/blog/static/events-02-19d7b07e777cb97faf124923384da200-17809.png 1236w,\n/blog/static/events-02-19d7b07e777cb97faf124923384da200-7b907.png 1540w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  \nWhen the event is within five days, weather based on the date and start location will appear on the list. Expand it to see the daily breakdown.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin: 0.4em auto; max-width: 412px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 82.71446862996159%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Event Details"\n        title=""\n        src="/blog/static/events-03-a10b35ec5168952256f4261537dcbf39-31818.png"\n        srcset="/blog/static/events-03-a10b35ec5168952256f4261537dcbf39-b3e18.png 103w,\n/blog/static/events-03-a10b35ec5168952256f4261537dcbf39-571c4.png 206w,\n/blog/static/events-03-a10b35ec5168952256f4261537dcbf39-31818.png 412w,\n/blog/static/events-03-a10b35ec5168952256f4261537dcbf39-1be92.png 618w,\n/blog/static/events-03-a10b35ec5168952256f4261537dcbf39-05b5b.png 824w,\n/blog/static/events-03-a10b35ec5168952256f4261537dcbf39-17809.png 1236w,\n/blog/static/events-03-a10b35ec5168952256f4261537dcbf39-26dcf.png 1562w"\n        sizes="(max-width: 412px) 100vw, 412px"\n      />\n    </span>\n  </span>\n  \nEvent details has all kinds of useful information such as:</p>\n<ul>\n<li>Time Zone</li>\n<li>Starting location link opening up Google Maps to help guide you</li>\n<li>Strava Route Links</li>\n<li>Starting Elevation</li>\n<li>Link to Event homepage</li>\n</ul>',frontmatter:{title:"Events",date:"2017-06-03T00:19:00.000Z",path:"/events/",parent:"/home/hypersprite/Documents/code/araceathlete-gatsby-material-ui-v1/src/pages/blog-posts/events.md absPath of file",tags:"newbie,events",description:"Events will keep your upcoming plans up front and on the radar",cover:{childImageSharp:{responsiveSizes:{src:"/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-7b166.png",sizes:"(max-width: 412px) 100vw, 412px",srcSet:"/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-32196.png 103w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-e3336.png 206w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-7b166.png 412w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-01e4b.png 618w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-0751a.png 824w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-832e5.png 1236w,\n/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-d700e.png 1442w",originalImg:"/blog/static/events-cover-46fd382a14ed7b3444649c8f074d794a-d700e.png",originalName:"events-cover.png",aspectRatio:1.5606060606060606,base64:"data:image/png;base64,"}}}}}},pathContext:{slug:"/blog-posts/events/"}}}});
